import React, { Component } from 'react';
import './App.css';
import MapContainer from './MapContainer';
import NameSearch from './NameSearch';
import Grid from '@material-ui/core/Grid';


export class App extends Component {
  state = {
    toCoordinates:{}
  };

  setCoordinates=(coordinates, isFrom)=>{
    let type;
    if(isFrom){
     type= {'fromCoordinates': coordinates}
    }
    else{
      type= {'toCoordinates': coordinates}
    }
    this.setState({
      type
    }, ()=>{
      console.log(this.state.toCoordinates)
  })

  }
  render(){
  return (
    <div>
      <Grid container
  direction="row"
  justify="flex-start"
  alignItems="center">
        <Grid item xs>
          <NameSearch setCoordinates={(e)=>this.setCoordinates(e, true)}/>
          <NameSearch setCoordinates={(e)=>this.setCoordinates(e, false)}/>
        </Grid>
        <Grid item xs>
          <MapContainer/>
        </Grid>
      </Grid>


    </div>
  );

  }
}

export default App;
